import React from 'react';
// import '../App.css';
import {Button} from '../Button';
import './AboutMe.css';
import portrait from './portrait.jpg';

function AboutMe() {
    return (
        <>
        <div className='about__display'>
            <div className="about__left">
                <img src={portrait} className="image" />
            </div>
            <div className="about__right">
                <p> I am a Wattpad author, having joined their Stars program in June 2020. I have posted books on their website since I was fifteen years old, and since then have finished 6 novels and novellas. I’m an aspiring author and blogger.

I’m also a recent graduate with a masters degree in history.</p>
            </div>
        </div>
        </>
    )
}

export default AboutMe
